INSERT INTO `model` (`modelid`, `companyid`, `model`, `body`, `img`, `videolink`, `summary`) VALUES ('1', '7', 'i5', 'crossover', 'i5.jpg','https://www.youtube.com/embed/6Viyt2aIOG8?ecver=2','The BMW i is a sub-brand of BMW founded in 2011 to design and manufacture plug-in electric vehicles.[1][2][3] The companys initial plans call for the release of two vehicles; the i3 all-electric car and the i8 plug-in hybrid. Concept versions of both these vehicles were shown at the 2009 Frankfurt Motor Show.');
INSERT INTO `model` (`modelid`, `companyid`, `model`, `body`, `img`, `videolink`, `summary`) VALUES ('2', '7', 'i7', 'sedan', 'i7.jpg','https://www.youtube.com/embed/zwI_32hu6F8?ecver=2','The BMW i is a sub-brand of BMW founded in 2011 to design and manufacture plug-in electric vehicles.[1][2][3] The company initial plans call for the release of two vehicles; the i3 all-electric car and the i8 plug-in hybrid. Concept versions of both these vehicles were shown at the 2009 Frankfurt Motor Show.[4]');
INSERT INTO `model` (`modelid`, `companyid`, `model`, `body`, `img`, `videolink`, `summary`) VALUES ('3', '7', 'i3', 'sedan', 'i3.jpg','https://www.youtube.com/embed/hUCwS6TIgQw?ecver=2','The i3 concept car was unveiled at the 2011 International Motor Show Germany.[12][17] and the production version was unveiled in July 2013.[18] Mass production of the i3 began in September 2013 and retail deliveries started in Europe in November 2013.[19][20] Deliveries in the U.S. began in May 2014.[21] Pricing in the United States starts at US$42,275 before any government incentives, and the range extender option costs an additional US$3,850. Prices in Germany start from €34,950 (US$46,400).[18][22] Pricing in the UK starts at GB£30,680');
INSERT INTO `model` (`modelid`, `companyid`, `model`, `body`, `img`, `videolink`, `summary`) VALUES ('4', '1', 'carmery', 'sedan', 'camery.jpg','https://www.youtube.com/embed/nwGMuKfHNNo?ecver=2','The Toyota Camry is an automobile sold internationally by the Japanese manufacturer Toyota since 1982, spanning multiple generations. Originally compact in size (narrow-body), later Camry models have grown to fit the mid-size classification (wide-body)—although the two sizes co-existed in the 1990s. Since the release of the wide-bodied versions, Camry has been extolled by Toyota as the');
INSERT INTO `model` (`modelid`, `companyid`, `model`, `body`, `img`, `videolink`, `summary`) VALUES ('5', '1', 'rav4', 'crossover', 'rav4.jpg', 'https://www.youtube.com/embed/bcC0EI8ohVE?ecver=2', 'Toyota RAV4 is a compact crossover SUV (sport utility vehicle) produced by the Japanese automobile manufacturer Toyota. This was the first compact crossover SUV;[1] it made its debut in Japan and Europe in 1994,[2] and in North America in 1995. The vehicle was designed for consumers wanting a vehicle that had most of the benefits of SUVs, such as increased cargo room, higher visibility, and the option of full-time four-wheel drive');
